import styled from "styled-components";

export const InputWrap = styled.div`
  width: fit-content;
  margin: 50px auto;
`
export const Input = styled.input`
  display: block;
  padding: 10px;
  margin-bottom: 20px;
  border-radius: 5px;
`
export const Message = styled.p`
  color: red;
`
export const Button = styled.button`
  margin: 10px;
  border-radius: 5px;
`
